import React from "react";
import { Outlet } from "react-router-dom";

const AdminDashboard = () => {
  return (
    <>
      <div className="products">
      <div className="productsNav">
        <p>My Profile</p>
        <p>Post Complaiint</p>
         <p>My Complaint</p>
      </div>

      <Outlet />
    </div>
    </>
  );
};
export default AdminDashboard;
